import React from 'react';
import {Jumbotron, Button} from 'react-bootstrap'
import SensoryStudio from './SensoryStudio.jpg'

const Jumbo = () =>{
  return(
    <Jumbotron className='container' style={{backgroundImage:`${SensoryStudio}`}}>
      <h1>Tactile Tots</h1>
      <p>
        Early Childhood education and Multi-Sensory Studio
      </p>
    </Jumbotron>
  )
}

export default Jumbo
